    @SuppressWarnings("unchecked")
    
    public void cambiarturno(JButton boton, int fila, int col){
            if(turno){
          boton.setText("1");
         control.fijarValor(fila, col, '1');
          turno=false;
        }
        else{
           boton.setText("0");
            control.fijarValor(fila, col, '0');
          turno=true;  
        }
        boton.setEnabled(false);
        control.imprimir();
        control.comparar();
       
    }
        
    
